import React, { useState } from 'react';
function Header() {
    const [isActive, setIsActive] = useState(false);

    const handleToggle = () => {
        setIsActive(!isActive);
    };

    return (
        <>
            <header>
                <div className="navbar">
                    <div className="nav-container">
                        <h3 className="logo">Techifo</h3>
                        <ul className="links">
                            <li><a href="https://www.google.com">Home</a></li>
                            <li><a href="https://www.google.com">About Us</a></li>
                            <li><a href="https://www.google.com">Service</a></li>
                            <li><a href="https://www.google.com">Contact Us</a></li>
                        </ul>
                        <button className="action-btn">Get started</button>
                        <i className="toggle_btn fa-solid fa-bars" onClick={handleToggle} id="btn">hh</i>
                    </div>
                    {isActive && (
                        <div id="drop-down-menu">
                            <ul>
                                <li><a href="https://www.google.com">Home</a></li>
                                <li><a href="https://www.google.com">About Us</a></li>
                                <li><a href="https://www.google.com">Service</a></li>
                                <li><a href="https://www.google.com">Contact Us</a></li>
                                <button className="action-btn">Get started</button>
                            </ul>
                        </div>
                    )}
                </div>
            </header>
        </>
    );
}
export default Header;

